import React from 'react';

const Contact = () => {
  return (
    <div className="min-h-screen bg-white text-black p-8">
      <h1 className="text-4xl font-bold mb-4">Contact Us</h1>
      <p className="mb-8">We'd love to hear from you! Reach out to us with any questions.</p>
      <h2 className="text-2xl font-bold mb-2">Contact Details</h2>
      <p>Email: info@manortea.com</p>
      <p>Phone: +91 98765 43210</p>
      <p>Location: Mumbai, India</p>
      <h2 className="text-2xl font-bold mt-8 mb-2">Follow Us</h2>
      <p>Instagram: @manortea</p>
      <p>Facebook: /manortea</p>
    </div>
  );
};

export default Contact;
